import React, { useState } from 'react';
import { createBooking } from '../api/api';

const dummyServices = [
  { id: 's1', name: 'Pooja A' },
  { id: 's2', name: 'Pooja B' },
  { id: 's3', name: 'pooja C' },
];

const dummyPandits = [
  { id: 'p1', name: 'shubham Singhal' },
  { id: 'p2', name: 'shyam sundar' },
  { id: 'p3', name: 'satyam vashney ' },
];

const dummyPoojas = [
  { id: 'po1', name: 'Ganesh puja' },
  { id: 'po2', name: 'Satyanarayan Puja' },
  { id: 'po3', name: 'Navagraha Puja' },
];

function Booking() {
  const [details, setDetails] = useState({
    serviceId: '',
    panditId: '',
    poojaId: '',
    date: '',
    time: '',
    location: '',
  });

  const handleChange = (e) => {
    setDetails({ ...details, [e.target.name]: e.target.value });
  };

  



  return (
    <form onSubmit={handleSubmit}>
      <h2>Book a Service</h2>

      <label>
        Service:
        <select name="serviceId" value={details.serviceId} onChange={handleChange} required>
          <option value="">Select Service</option>
          {dummyServices.map((service) => (
            <option key={service.id} value={service.id}>
              {service.name}
            </option>
          ))}
        </select>
      </label>

      <br />

      <label>
        Pandit:
        <select name="panditId" value={details.panditId} onChange={handleChange} required>
          <option value="">Select Pandit</option>
          {dummyPandits.map((pandit) => (
            <option key={pandit.id} value={pandit.id}>
              {pandit.name}
            </option>
          ))}
        </select>
      </label>

      <br />

      <label>
        Pooja:
        <select name="poojaId" value={details.poojaId} onChange={handleChange} required>
          <option value="">Select Pooja</option>
          {dummyPoojas.map((pooja) => (
            <option key={pooja.id} value={pooja.id}>
              {pooja.name}
            </option>
          ))}
        </select>
      </label>

      <br />

      <label>
        Date:
        <input
          type="date"
          name="date"
          value={details.date}
          onChange={handleChange}
          required
        />
      </label>

      <br />

      <label>
        Time:
        <input
          type="time"
          name="time"
          value={details.time}
          onChange={handleChange}
          required
        />
      </label>

      <br />

      <label>
        Location:
        <input
          type="text"
          name="location"
          placeholder="Enter location"
          value={details.location}
          onChange={handleChange}
          required
        />
      </label>

      <br />

      <button type="submit">Book Now</button>
    </form>
  );
}

export default Booking;
